  render() {
    return (
      <div className="container my-4">
        <h1>News Dose - Top Headlines</h1>
        <div className="row">
          <div className="col-md-4">
            <NewsItem title="mytitle" description="myDesc" image/>
          </div>
          <div className="col-md-4">
            <NewsItem title="mytitle" description="myDesc" />
          </div>
          <div className="col-md-4">
            <NewsItem title="mytitle" description="myDesc" />
          </div>
        </div>
      </div>
    );
  }
}

export default News;
